package practice_codes.hackerrank;

import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertFalse;
import static org.junit.jupiter.api.Assertions.assertTrue;

class StringPatterCheckTest {
    @Test
    void bestCase() {
        assertTrue(StringPatterCheck.callForCheckPatternCheck("abcabc"));
        assertTrue(StringPatterCheck.callForCheckPatternCheck("abbcabbc"));
        assertTrue(StringPatterCheck.callForCheckPatternCheck("aabccaabcc"));
        assertFalse(StringPatterCheck.callForCheckPatternCheck("aabbcaabbcc"));
        assertFalse(StringPatterCheck.callForCheckPatternCheck("asnmdkasndkasndiuskdnaks"));
    }

    @Test
    void cornerCase() {
        assertFalse(StringPatterCheck.callForCheckPatternCheck(null));
        assertFalse(StringPatterCheck.callForCheckPatternCheck("abcabcc"));
        assertFalse(StringPatterCheck.callForCheckPatternCheck("null"));
        assertFalse(StringPatterCheck.callForCheckPatternCheck("abcdabcd"));
        assertFalse(StringPatterCheck.callForCheckPatternCheck("cbacba"));
    }

    @Test
    void timeComplexityCase() {
        assertTrue(StringPatterCheck.callForCheckPatternCheck(""));
        assertFalse(StringPatterCheck.callForCheckPatternCheck(""));
        assertFalse(StringPatterCheck.callForCheckPatternCheck(""));
        assertTrue(StringPatterCheck.callForCheckPatternCheck(""));
    }
}